import React from 'react';
import Customer from './components/Customer';

const customer = {
  'id': 1,
  'name': '홍길동',
  'birthday': '971202',
  'gender': '남자',
  'job': '학생'
}

const App = () => {

  return(
    <div>
      <Customer 
        name={customer.name}

        birthday={customer.birthday}
        gender={customer.gender}
        job={customer.job}
        />
    </div>
  )
}

export default App;
